export default (state, action) => {
    switch (action.type) {
        case 'SET_TOLL':
            return {
                ...state,
                tollData: action.payload
            }
        case 'SET_VEHICLE':
            return {
                ...state,
                vehicleData: action.payload
            }

        default: return state
    }
}
